INSERT INTO `g_article` VALUES ('154674422740494', '自动隧道的配置', '<div yne-bulb-block=\"image\"><img alt=\"\" src=\"D:/%E6%9C%89%E9%81%93%E4%BA%91%E7%AC%94%E8%AE%B0/qq79B38604B5C84AEF6FF337241604A176/a9bb771865414b8cb4b7cb551ca61028/clipboard.png\"><img src=\"data:image/png;base64,\" style=\"max-width: 100%;\"></div><p><br></p><p><br></p><pre><code>R1：inter f0/0<br>    ipv6 addr 2001:3355:1::1/64<br>    no shut<br>    exit<br>    ipv6 route ::/0 2001:3355:1::2<br>R2：<br>    router rip<br>    network 192.168.1.0<br>    network 1.0.0.0<br>    inter f0/0<br>    ipv6 addr 2001:3355:1::2/64<br>    no shut<br>    inter f0/1<br>    ip addr 192.168.1.1 255.255.255.0<br>    no shut<br>    inter lo 0<br>    ip addr 1.1.1.1 255.255.255.0<br>    no shut<br>    inter tunnel 0<br>    ipv6 addr 2002:0101:0101::/128<br>    tunnel source lo 0<br>    tunnel mode ipv6ip 6to4<br>    no shut<br>    exit<br>    ipv6 route 2002::/16 tunnel 0<br>    ipv6 route 2001:3355:2::/64 2002:0202:0202::    <br>R3：router rip <br>    network 192.168.1.0<br>    network 192.168.2.0<br>    inter f0/1<br>    ip addr 192.168.1.2 255.255.255.0<br>    no shut<br>    inter f0/0<br>    ip addr 192.168.2.1 255.255.255.0<br>    no shut<br>R4：router rip<br>    network 192.168.2.0<br>    network 2.0.0.0<br>    inter f0/0<br>    ip addr 192.168.2.2 255.255.255.0<br>    no shut<br>    inter f0/1<br>    ipv6 addr 2001:3355:2::1/64<br>    no shut<br>    inter lo 0<br>    ip addr 2.2.2.2 255.255.255.0<br>    inter tunnel 0<br>    ipv6 addr 2002:0202:0202::/128<br>    tunnel source lo 0<br>    tunnel mode ipv6ip 6to4<br>    no shut<br>    exit<br>    ipv6 route 2002::/16 tunnel 0<br>    ipv6 route 2001:3355:1::/64 2002:0101:0101::<br>R5：inter f0/1<br>    ipv6 addr 2001:3355:2::2/64<br>    no shut<br>    exit<br>    ipv6 router ::/0 2001:3355:2::1</code></pre><p><br></p>', '11', '38', '2019-01-06  11:10:27', null);
INSERT INTO `g_article` VALUES ('154674480635721', 'NAT PT静态配置', '<p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></p><p><br></p><pre><code>R1：inter f0/0<br>    ipv6 addr 2000::1/16<br>    no shut<br>    ipv6 nat<br>    inter f0/1<br>    ip addr 192.168.0.1 255.255.255.0<br>    no shut<br>    ipv6 nat<br>    exit<br>    router rip<br>    network 192.168.0.0<br>    ipv6 nat v6v4 source 2000::2 192.168.0.3<br>    ipv6 nat v4v6 source 192.168.1.2 2001::1<br>    ipv6 nat prefix 2001::/96<br>R2：inter f0/0<br>    ip addr 192.168.0.2 255.255.255.0<br>    no shut<br>    inter f0/1<br>    ip addr 192.168.1.1 255.255.255.0<br>    no shut<br>    exit<br>    router rip<br>    network 192.168.0.0<br>    network 192.168.1.0<br>C1：ip 2000::2/16 2000::1<br>C2：ip 192.168.1.2 192.168.1.1</code></pre><p><br></p>', '4', '38', '2019-01-06  11:20:06', null);
INSERT INTO `g_article` VALUES ('154674539075203', 'Java设计-单例模式', '<pre><code>/**<br> * 懒汉式<br> */<br>class Simple{<br><br>    static private Simple simple;<br><br>    private Simple(){}<br><br>    static Simple getSimple(){<br>        if(simple == null){                     //第一重锁<br>            synchronized (Simple.class){<br>                if(simple == null){             //第二重锁，双重检验锁<br>                    simple = new Simple();<br>                }<br>            }<br>        }<br>        return simple;<br>    }<br>}<br><br>/**<br> * 饿汉式<br> */<br>class Singleton{<br><br>    static private Singleton singleton = new Singleton();<br><br>    private Singleton(){}<br><br>    static Singleton getSingleton(){<br>        return singleton;<br>    }<br><br>}<br><br>public class Test001 {<br><br>    public static void main(String[] args){<br>        Simple simple = Simple.getSimple();<br>        Simple simple1 = Simple.getSimple();<br>        System.out.println(simple == simple1);<br>        Singleton singleton = Singleton.getSingleton();<br>        Singleton singleton1 = Singleton.getSingleton();<br>        System.out.println(singleton == singleton1);<br>    }<br>}</code></pre><p><br></p>', '1', '33', '2019-01-06  11:29:50', null);
INSERT INTO `g_article` VALUES ('154674613054605', 'JVM参数调优与垃圾回收机制', '<div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: x-large;\">自动内存管理机制</span></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large;\"><span style=\"font-weight: bold;\">Java虚拟机原理</span>&nbsp;</span></div><div yne-bulb-block=\"paragraph\">&nbsp; &nbsp;&nbsp;<span style=\"font-family: 宋体;\">所谓虚拟机，就是一台虚拟的机器。他是一款软件，用来执行一系列虚拟计算指令，大体上虚拟机可以分为</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">系统虚拟机和程序虚拟机， 大名鼎鼎的Visual Box、Vmare就属于系统虚拟机，他们完全是对物理计算的仿真，</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">提供了一个可以运行完整操作系统的软件平台。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">&nbsp;程序虚拟机典型代码就是Java虚拟机，它专门为执行单个计算程序而计算，在Java虚拟机中执行的指令我们成为Java</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">自己码指令。无论是系统虚拟机还是程序虚拟机，在上面运行的软件都被限制于虚拟机提供的资源中。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">&nbsp;Java发展至今，出现过很多虚拟机，做初Sun使用的一款叫ClassIc的Java虚拟机，到现在引用最广泛的是HotSpot虚拟</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">机，除了Sum意外，还有BEA的Jrockit，目前Jrockit和HostSopt都被oralce收入旗下，大有整合的趋势。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体;\">Java内存结构。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-family: 宋体; font-weight: bold;\"><br></span></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large; font-weight: bold;\">Java内存结构</span></div><div yne-bulb-block=\"paragraph\"><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><span style=\"font-size: large;\"><br></span></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\">1、&nbsp;类加载子系统:负责从文件系统或者网络加载Class信息，加载的信息存放在一块称之方法区的内存空间。</div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">2、&nbsp;方法区:就是存放类的信息、常量信息、常量池信息、包括字符串字面量和数字常量等。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">3、&nbsp;Java堆：在Java虚拟机启动的时候建立Java堆，它是Java程序最主要的内存工作区域，几乎所有的对象实例都存放到</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">Java堆中，堆空间是所有线程共享。</span></div><div yne-bulb-block=\"paragraph\">4、&nbsp;直接内存：JavaNio库允许Java程序直接内存，从而提高性能，通常直接内存速度会优于Java堆。读写频繁的场合可能会考虑使用。</div><div yne-bulb-block=\"paragraph\">5、&nbsp;每个虚拟机线程都有一个私有栈，一个线程的Java栈在线程创建的时候被创建，Java栈保存着局部变量、方法参数、同事Java的方法调用、</div><div yne-bulb-block=\"paragraph\">返回值等。</div><div yne-bulb-block=\"paragraph\">6、&nbsp;本地方法栈，最大不同为本地方法栈用于本地方法调用。Java虚拟机允许Java直接调用本地方法（通过使用C语言写）</div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">7、&nbsp;垃圾收集系统是Java的核心，也是不可少的，Java有一套自己进行垃圾清理的机制，开发人员无需手工清理，下一节课详细讲。</span></div><div yne-bulb-block=\"paragraph\">8、&nbsp;PC（Program Couneter）寄存器也是每个线程私有的空间， Java虚拟机会为每个线程创建PC寄存器，在任意时刻，</div><div yne-bulb-block=\"paragraph\">一个Java线程总是在执行一个方法，这个方法称为当前方法，如果当前方法不是本地方法，PC寄存器总会执行当前正在被执行的指令，</div><div yne-bulb-block=\"paragraph\">如果是本地方法，则PC寄存器值为Underfined，寄存器存放如果当前执行环境指针、程序技术器、操作栈指针、计算的变量指针等信息。</div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">9、&nbsp;虚拟机核心的组件就是执行引擎，它负责执行虚拟机的字节码，一般户先进行编译成机器码后执行。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">堆、栈、方法区概念区别。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\"><br></span></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large; font-weight: bold;\">Java堆</span></div><div yne-bulb-block=\"paragraph\">堆内存用于存放由new创建的对象和数组。在堆中分配的内存，由java虚拟机自动垃圾回收器来管理。在堆中产生了一个数组或者对象后，还可以在栈中定义一个特殊的变量，这个变量的取值等于数组或者对象在堆内存中的首地址，在栈中的这个特殊的变量就变成了数组或者对象的引用变量，以后就可以在程序中使用栈内存中的引用变量来访问堆中的数组或者对象，引用变量相当于为数组或者对象起的一个别名，或者代号。</div><div yne-bulb-block=\"paragraph\">&nbsp;</div><div yne-bulb-block=\"paragraph\">根据垃圾回收机制的不同，Java堆有可能拥有不同的结构，最为常见的就是将整个Java堆分为</div><div yne-bulb-block=\"paragraph\">新生代和老年代。其中新声带存放新生的对象或者年龄不大的对象，老年代则存放老年对象。</div><div yne-bulb-block=\"paragraph\">新生代分为den区、s0区、s1区，s0和s1也被称为from和to区域，他们是两块大小相等并且可以互相角色的空间。</div><div yne-bulb-block=\"paragraph\">绝大多数情况下，对象首先分配在eden区，在新生代回收后，如果对象还存活，则进入s0或s1区，之后每经过一次</div><div yne-bulb-block=\"paragraph\">新生代回收，如果对象存活则它的年龄就加1，对象达到一定的年龄后，则进入老年代。</div><div yne-bulb-block=\"paragraph\">&nbsp;<img src=\"data:image/png;base64,\" style=\"max-width: 100%;\"></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large; font-weight: bold;\">Java栈</span></div><div yne-bulb-block=\"paragraph\">Java栈是一块线程私有的空间，一个栈，一般由三部分组成:局部变量表、操作数据栈和帧数据区</div><div yne-bulb-block=\"paragraph\">局部变量表：用于报错函数的参数及局部变量</div><div yne-bulb-block=\"paragraph\">操作数栈：主要保存计算过程的中间结果，同时作为计算过程中的变量临时的存储空间。</div><div yne-bulb-block=\"paragraph\">帧数据区:除了局部变量表和操作数据栈以外，栈还需要一些数据来支持常量池的解析，这里帧数据区保存着</div><div yne-bulb-block=\"paragraph\">访问常量池的指针，方便计程序访问常量池，另外当函数返回或出现异常时卖虚拟机子必须有一个异常处理表，方便发送异常</div><div yne-bulb-block=\"paragraph\">的时候找到异常的代码，因此异常处理表也是帧数据区的一部分。</div></div></div></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"><br></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large;\">Java方法区</span></div><div yne-bulb-block=\"paragraph\">Java方法区和堆一样，方法区是一块所有线程共享的内存区域，他保存系统的类信息。</div><div yne-bulb-block=\"paragraph\">比如类的字段、方法、常量池等。方法区的大小决定系统可以保存多少个类。如果系统</div><div yne-bulb-block=\"paragraph\">定义太多的类，导致方法区溢出。虚拟机同样会抛出内存溢出的错误。方法区可以理解</div><div yne-bulb-block=\"paragraph\">为永久区。</div></div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large;\"><br></span></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: x-large;\">虚拟机参数配置</span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: x-large;\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"font-size: large; font-weight: bold;\">什么是虚拟机参数配置</span></div><div yne-bulb-block=\"paragraph\">在虚拟机运行的过程中，如果可以跟踪系统的运行状态，那么对于问题的故障</div><div yne-bulb-block=\"paragraph\">排查会有一定的帮助，为此，在虚拟机提供了一些跟踪系统状态的参数，使用</div><div yne-bulb-block=\"paragraph\">给定的参数执行Java虚拟机，就可以在系统运行时打印相关日志，用于分析实际</div><div yne-bulb-block=\"paragraph\">问题。我们进行虚拟机参数配置，其实就是围绕着堆、栈、方法区、进行配置。</div><div yne-bulb-block=\"paragraph\">你说下&nbsp;你熟悉那些jvm参数调优。</div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: large;\">堆的参数配置</span></div><div yne-bulb-block=\"paragraph\">-XX:+PrintGC&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;每次触发GC的时候打印相关日志</div><div yne-bulb-block=\"paragraph\">-XX:+UseSerialGC &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;串行回收</div><div yne-bulb-block=\"paragraph\">-XX:+PrintGCDetails&nbsp;&nbsp;更详细的GC日志</div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">-Xms&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;堆初始值</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">-Xmx&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;堆最大可用值</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">-Xmn&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;新生代堆最大可用值</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">-XX:SurvivorRatio &nbsp;&nbsp;&nbsp;&nbsp;用来设置新生代中eden空间和from/to空间的比例.</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">含以-XX:SurvivorRatio=eden/from=den/to</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">总结:在实际工作中，我们可以直接将初始的堆大小与最大堆大小相等，</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(194, 79, 74);\">这样的好处是可以减少程序运行时垃圾回收次数，从而提高效率。</span></div><div yne-bulb-block=\"paragraph\">-XX:SurvivorRatio &nbsp;&nbsp;&nbsp;&nbsp;用来设置新生代中eden空间和from/to空间的比例。</div><div yne-bulb-block=\"paragraph\"><br></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: large;\">设置最大堆内存</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">参数:&nbsp;-Xms5m -Xmx20m -XX:+PrintGCDetails -XX:+UseSerialGC -XX:+PrintCommandLineFlags</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><pre><code>public class JvmDemo01 {<br> <br>public static void main(String[] args) throws InterruptedException {<br>byte[] b1 = new byte[1 * 1024 * 1024];<br>System.out.println(\"分配了1m\");<br>jvmInfo();<br>Thread.sleep(3000);<br>byte[] b2 = new byte[4 * 1024 * 1024];<br>System.out.println(\"分配了4m\");<br>Thread.sleep(3000);<br>jvmInfo();<br> <br>}<br>static private String toM(long maxMemory) {<br>float num = (float) maxMemory / (1024 * 1024);<br>DecimalFormat df = new DecimalFormat(\"0.00\");// 格式化小数<br>String s = df.format(num);// 返回的是String类型<br>return s;<br>}<br>static private void jvmInfo() {<br>// 最大内存<br>long maxMemory = Runtime.getRuntime().maxMemory();<br>System.out.println(\"maxMemory:\" + maxMemory + \",转换为M:\" + toM(maxMemory));<br>// 当前空闲内存<br>long freeMemory = Runtime.getRuntime().freeMemory();<br>System.out.println(\"freeMemory:\" +freeMemory+\",转换为M:\"+toM(freeMemory));<br>// 已经使用内存<br>long totalMemory = Runtime.getRuntime().totalMemory();<br>System.out.println(\"totalMemory:\" +totalMemory+\",转换为M\"+toM(totalMemory));<br>}<br>}</code></pre><p><br></p><p><br></p><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: large;\">设置新生代与老年代优化参数</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">-Xmn&nbsp;&nbsp;&nbsp;&nbsp;新生代大小，一般设为整个堆的1/3到1/4左右</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">-XX:SurvivorRatio&nbsp;&nbsp;&nbsp;&nbsp;设置新生代中eden区和from/to空间的比例关系n/1</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">设置新生代比例参数</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">参数:&nbsp;-Xms20m -Xmx20m -Xmn1m -XX:SurvivorRatio=2 -XX:+PrintGCDetails -XX:+UseSerialGC</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: large;\">设置新生与老年代代参数</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">-Xms20m -Xmx20m -XX:SurvivorRatio=2 -XX:+PrintGCDetails -XX:+UseSerialGC</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">-XX:NewRatio=2</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">总结:不同的堆分布情况，对系统执行会产生一定的影响，在实际工作中，</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">应该根据系统的特点做出合理的配置，基本策略：尽可能将对象预留在新生代，</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">减少老年代的GC次数。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">除了可以设置新生代的绝对大小(-Xmn),可以使用(-XX:NewRatio)设置新生代和老年</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">代的比例:-XX:NewRatio=老年代/新生代</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">内存溢出解决办法</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">设置堆内存大小</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">错误原因:&nbsp;java.lang.OutOfMemoryError: Java heap space 堆内存溢出</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">解决办法:设置堆内存大小&nbsp;-Xms1m –Xmx10m -XX:+HeapDumpOnOutOfMemoryError</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><div yne-bulb-block=\"paragraph\"><span style=\"font-weight: bold; font-size: large;\">设置栈内存大小</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">错误原因: java.lang.StackOverflowError &nbsp;栈内存溢出</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">栈溢出&nbsp;产生于递归调用，循环遍历是不会的，但是循环方法里面产生递归调用，&nbsp;也会发生栈溢出。</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">解决办法:设置线程最大调用深度</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\">-Xss5m&nbsp;设置最大调用深度</span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div><div yne-bulb-block=\"paragraph\"><span style=\"color: rgb(123, 91, 161);\"><br></span></div></div></div></div></div></div></div><div yne-bulb-block=\"paragraph\"><br></div></div>', '5', '33', '2019-01-06  11:42:10', null);
INSERT INTO `g_article` VALUES ('154674872940303', 'OSS-Aliyun-阿里云OSS对象存储', '<p><span style=\"font-weight: bold; font-size: large;\">maven依赖</span></p><p><span style=\"font-weight: bold; font-size: large;\"><br></span></p><pre><code>&lt;!--aliyun OSS--&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;com.aliyun.oss&lt;/groupId&gt;<br>            &lt;artifactId&gt;aliyun-sdk-oss&lt;/artifactId&gt;<br>            &lt;version&gt;2.4.0&lt;/version&gt;<br>        &lt;/dependency&gt;<br>        &lt;!-- 文件上传 --&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;commons-fileupload&lt;/groupId&gt;<br>            &lt;artifactId&gt;commons-fileupload&lt;/artifactId&gt;<br>            &lt;version&gt;1.3.1&lt;/version&gt;<br>        &lt;/dependency&gt;</code></pre><p><br></p><p><br></p><p><span style=\"font-size: medium; font-weight: bold;\">工具类</span></p><p><span style=\"font-size: medium; font-weight: bold;\"><br></span></p><pre><code>package com.spirit.oss;<br><br>import com.aliyun.oss.ClientException;<br>import com.aliyun.oss.OSSClient;<br>import com.aliyun.oss.OSSException;<br>import com.aliyun.oss.model.CannedAccessControlList;<br>import com.aliyun.oss.model.CreateBucketRequest;<br>import com.aliyun.oss.model.PutObjectRequest;<br>import com.aliyun.oss.model.PutObjectResult;<br>import com.spirit.constant.ConstantProperties;<br>import com.spirit.util.IDUtils;<br>import org.slf4j.LoggerFactory;<br>import org.springframework.web.multipart.MultipartFile;<br><br>import java.io.File;<br>import java.io.IOException;<br>import java.text.SimpleDateFormat;<br>import java.util.Date;<br><br>/**<br>* @Description:    aliyunOSS工具类<br>* @Author:         印国林<br>* @CreateDate:     2018/10/31/031 21:43<br>* @Version:        1.0<br>*/<br>public class AliyunOSSUtil {<br><br>    private static final org.slf4j.Logger logger = LoggerFactory.getLogger(AliyunOSSUtil.class);<br><br>    /**<br>     * 普通文件上传<br>     * @param file<br>     * @return<br>     */<br>    public static String normalFileUpload(File file){<br>        logger.info(\"---------------OSS文件开始上传------------------\");<br><br>        String endpoint = ConstantProperties.JAVA_FILE_ENDPONT;<br>        String accessKeyId = ConstantProperties.JAVA_FILE_KEYID;<br>        String accessKeySecret = ConstantProperties.JAVA_FILE_KEYSECRET;<br>        String bucketName = ConstantProperties.JAVA_FILE_BUCKETNAME;<br>        String fileHost = ConstantProperties.JAVA_FILE_FILEHOST;<br><br>        SimpleDateFormat dateFormat = new SimpleDateFormat(\"yyyy-MM-dd\");<br>        String dateStr = dateFormat.format(new Date());<br><br>        if(file == null){<br>            return  null;<br>        }<br><br>        //创建OSSClient对象<br>        OSSClient ossClient = new OSSClient(endpoint,accessKeyId,accessKeySecret);<br><br>        try{<br>            //名为bucketName的容器不存在，就创建<br>            if(!ossClient.doesBucketExist(bucketName)){<br>                ossClient.createBucket(bucketName);<br>                CreateBucketRequest createBucketRequest = new CreateBucketRequest(bucketName);<br>                //设置权限<br>                createBucketRequest.setCannedACL(CannedAccessControlList.PublicRead);<br>                ossClient.createBucket(createBucketRequest);<br>            }<br><br>            //创建文件路径<br>            String fileUrl = fileHost+ \"/\" + (dateStr+ \"/\" +file.getName());<br><br>            //上传文件<br>            PutObjectResult putObjectResult = ossClient.putObject(new PutObjectRequest(bucketName, fileUrl, file));<br><br>            //设置权限 公开读<br>            ossClient.setBucketAcl(bucketName,CannedAccessControlList.PublicRead);<br><br>            String url = \"https://\"+ConstantProperties.JAVA_FILE_BUCKETNAME+\".\"+ConstantProperties.JAVA_FILE_ENDPONT+\"/\"+fileUrl;<br><br>            if(putObjectResult != null){<br>                logger.info(\"---------------OOS文件上传成功---------------\");<br>                logger.error(\"Oss地址：\"+url);<br>                return url;<br>            }<br><br>        }catch (OSSException oe){<br>            logger.error(oe.getMessage());<br>        }catch (ClientException ce){<br>            logger.error(ce.getMessage());<br>        }finally {<br>            //关闭<br>            ossClient.shutdown();<br>        }<br><br>        return null;<br>    }<br><br><br>    /**<br>     * MultipartFile文件上传<br>     * @param multipartFile<br>     * @return <br>     * @throws IOException<br>     */<br>    public static String MultipartFileUpload(MultipartFile multipartFile) throws IOException {<br><br>        // 获取文件名<br>        String fileName = multipartFile.getOriginalFilename();<br>        // 获取文件后缀<br>        String prefix=fileName.substring(fileName.lastIndexOf(\".\"));<br><br>        if (prefix.equals(\".jpg\") || prefix.equals(\".png\") || prefix.equals(\".JPG\") || prefix.equals(\".PNG\")){<br>            // 用uuid作为文件名，防止生成的临时文件重复<br>            File excelFile = File.createTempFile(IDUtils.genItemId()+\"\", prefix);<br>            // MultipartFile to File<br>            multipartFile.transferTo(excelFile);<br><br>            //上传<br><br>            String url = AliyunOSSUtil.normalFileUpload(excelFile);<br><br>            //程序结束时，删除临时文件<br>            deleteFile(excelFile);<br><br>            return url;<br>        }<br><br>        return \"false\";<br><br>    }<br><br><br>    /**<br>     * 删除文件<br>     * @param files<br>     */<br>    private static void deleteFile(File... files) {<br>        for (File file : files) {<br>            if (file.exists()) {<br>                file.delete();<br>            }<br>        }<br>    }<br>}</code></pre><p><span style=\"font-weight: bold; font-size: large;\"><br></span></p><p><span style=\"font-weight: bold; font-size: large;\">application.properties</span></p><p><span style=\"font-weight: bold; font-size: large;\"><br></span></p><pre><code>java.file.endpoint = oss-cn-beijing.aliyuncs.com<br>java.file.keyid = LTAIvXuAo73fyGAT<br>java.file.keysecret =rcW4z2LMrqasXD892qDJreaPohmXOn<br>java.file.bucketname = guolin<br>java.file.filehost = system</code></pre><p><br></p><p><span style=\"font-weight: bold; font-size: large;\">配置类</span></p><p><span style=\"font-weight: bold; font-size: large;\"><br></span></p><pre><code>package com.constant;<br><br>import org.springframework.beans.factory.InitializingBean;<br>import org.springframework.beans.factory.annotation.Value;<br>import org.springframework.stereotype.Component;<br><br>/**<br> * 配置文件类<br> */<br>@Component<br>public class ConstantProperties implements InitializingBean {<br><br>    @Value(\"${java.file.endpoint}\")<br>    private String java_file_endpoint;<br><br>    @Value(\"${java.file.keyid}\")<br>    private String java_file_keyid;<br><br>    @Value(\"${java.file.keysecret}\")<br>    private String java_file_keysecret;<br><br>    @Value(\"${java.file.bucketname}\")<br>    private String java_file_bucketname;<br><br>    @Value(\"${java.file.filehost}\")<br>    private String java_file_filehost;<br><br><br>    public static String JAVA_FILE_ENDPONT;<br><br>    public static String JAVA_FILE_KEYID;<br><br>    public static String JAVA_FILE_KEYSECRET;<br><br>    public static String JAVA_FILE_BUCKETNAME;<br><br>    public static String JAVA_FILE_FILEHOST;<br><br><br>    @Override<br>    public void afterPropertiesSet() throws Exception {<br><br>        JAVA_FILE_ENDPONT = java_file_endpoint;<br><br>        JAVA_FILE_KEYID = java_file_keyid;<br><br>        JAVA_FILE_KEYSECRET = java_file_keysecret;<br><br>        JAVA_FILE_BUCKETNAME = java_file_bucketname;<br><br>        JAVA_FILE_FILEHOST = java_file_filehost;<br><br>    }<br>}</code></pre><p><br></p><p><br></p>', '3', '49', '2019-01-06  12:25:29', null);

